import './App.css';
import React from 'react';
import { ReactDOM, render } from 'react-dom';
import { useState } from 'react';

function App() {
  var [button,buton_value]=useState(0);
  const [left_margin,margin_value]=useState(Math.random()*70)

function Onclick(){
buton_value(button + 1)
margin_value(Math.random()*70)
}
function Positon_change(){margin_value(Math.random()*70)
}

function Redcar(){
  
  return(<div className='redcar'
  onAnimationIteration={onClick}
   style={{padding:(40 +"px "+15+"px"),
position:'absolute',
borderRadius:"30px",
animation: "car-animation "+((Math.random()*8)+1)+"s infinite",
backgroundColor:"rgb("+Math.random()*300+','+Math.random()*300+','+ Math.random()*300+')',
marginLeft:((Math.random()*70)+"vw"),
marginTop:(Math.random()*-40)+"vh",

}}> </div>)}

function All_car(){
  return((
  <div>
    <Redcar  onAnimationIteration={onclick}/>

  </div>
        ))}

  
  return (
    
    <body className='body'>
      <header className='header'>
        <img className='logo1' src='https://www.bing.com/th?id=OIP.TLKTJDEq6qu4ECeo7LGkYwHaEu&pid=3.1&cb=&w=300&h=300&p=0' alt=''></img>
        <h2>Tinny cars</h2>
        <img className='logo2' src='https://www.bing.com/th?id=OIP.TLKTJDEq6qu4ECeo7LGkYwHaEu&pid=3.1&cb=&w=300&h=300&p=0' alt=''></img>
        </header>
      <nav className='nav'>
        <h1><a>Login</a></h1>
        <h1><a>Home</a></h1>
        <h1><a>About</a></h1>
      </nav> 

      <div className='body'>
        <section className='road'>
        <button style={{
          position:'relative',
          zIndex:"10"
          }} onClick={Onclick}>score :{button}</button>
        <section className='running_cars'>
          
            <All_car />
            

          </section>
          <div>
            <nav className='main_car'></nav>
          </div>
          </section>
          </div>
      <footer>Footer</footer>

    </body>
  
    
  );
}

export default App;
